import styled from 'styled-components'

const outerContainer = styled.div`
  backgruond: black;
`
const AboutContainer = styled.div`
  min-height: calc(100vh - 60px);
  margin: 0 auto;
  max-width: 1100px;
  padding: 0;
`

const ProfilePicture = styled.img`
  margin: 0 auto;
  height: 100%;
  width: 100%;
  max-height: 100vh;
  object-fit: cover;
  object-position: 100% 0;
  padding: 0;
`

const About = () => {
  return (
    <AboutContainer>
      <ProfilePicture src = {require('../content/img/igdp.jpg').default}/>
    </AboutContainer>
  )
}

export default About
